var FP_LP_DONATIONS_TRUST = {
    init: function() {
        this.addLifestyleImagesToSlideshow();
        this.addVideoToSlideshow();
        this.addArrowToSlideshow();
        this.fixColor();
        this.virtualMirror();
        this.outOfStock();
        this.determinePopup();
        this.magnificationPopup();
        this.popupEvents();
        this.addVideo();
        this.changeOrder();
        this.attachEvents();
    },
    addLifestyleImagesToSlideshow: function() {
        var persons = $('.preview__person a img')
        for (var i = 0; i < persons.length; i++) {
            var thumbnail = $(persons[i]).attr('src')
            $('#ProductThumbs').append('<div class="product-single__thumb-wrapper active-variant"><a href="' + thumbnail + '" data-image="' + thumbnail + '" data-zoomimage="ffdd" class="product-single__thumbnail fp_lifestyle_thumbnail"><img src="' + thumbnail + '" alt="Casper"></a></div>')
        }

    },
    addVideoToSlideshow: function() {
        var poster = 'data:image/png;base64,'
        var videoIcon = 'data:image/png;base64,';
        var videoPlayBtn = '<div class="play-button-wrapper"><div title="Play video" class="play-gif" id="circle-play-b"><!-- SVG Play Button --><svg width="40" height="40" viewBox="0 0 40 40" fill="none" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" clip-rule="evenodd" d="M20 40C31.0457 40 40 31.0457 40 20C40 8.9543 31.0457 0 20 0C8.9543 0 0 8.9543 0 20C0 31.0457 8.9543 40 20 40ZM30.6627 20.1659C30.7804 20.0866 30.7804 19.9134 30.6627 19.8341L14.857 9.18781C14.7242 9.09833 14.5453 9.19352 14.5453 9.35369L14.5453 30.6463C14.5453 30.8064 14.7242 30.9016 14.857 30.8121L30.6627 20.1659Z" fill="white"/></svg><span>WATCH VIDEO</span></div></div>';
        var videoContent = '<div class="video-container" id="video-container"><video controls id="video2" preload="metadata" poster="' + poster + '"><source src="https://cdn.shopify.com/s/files/1/0797/7215/files/find_your_fit.mp4?v=1608194262" type="video/mp4"></video>' + videoPlayBtn + '</div>'

        $('.product-main-image').append(videoContent);
        $('.product-main-image .video-container').hide();

        $('#ProductThumbs').prepend('<div class="product-single__thumb-wrapper active-variant"><a href="#" data-image="' + poster + '" data-zoomimage="ffdd" class="product-single__thumbnail fp_thumbnail"><img src="' + videoIcon + '" alt="Casper"></a></div>')
        $('.fp_thumbnail').on('click', function() {
            setTimeout(function() { $('#ProductPhotoImg').attr('src', poster) }, 10);
        })

        var video = document.getElementById("video2");
        var circlePlayButton = document.getElementById("circle-play-b");

        function togglePlay() {
            if (video.paused || video.ended) {
                video.play();
            } else {
                video.pause();
            }
        }

        circlePlayButton.addEventListener("click", togglePlay);
        video.addEventListener("playing", function() {
            circlePlayButton.style.opacity = 0;
        });
        video.addEventListener("pause", function() {
            circlePlayButton.style.opacity = 1;
        });


        $('.product-single__thumb-wrapper').on('click', function() {

            if ($(this).is(":first-child")) {
                $('.product-main-image a').hide()
                $('.product-main-image .video-container').show();
            } else {
                $('.product-main-image .video-container').hide();
                $('.product-main-image a').show();
            }


            if ($(this).is(":first-child") || $(this).children().hasClass('fp_lifestyle_thumbnail')) {
                $('.product-single__photos').css('height', '330px')
                $('.product-single__photos').css('max-height', '330px')
                $('.product-single__photos a img').addClass('fp_fit')

            } else {
                $('.product-single__photos').css('height', '160px');
                $('.product-single__photos').css('max-height', '160px');
                $('.product-single__photos a img').removeClass('fp_fit')
            }



        })
    },
    addArrowToSlideshow: function() {
        var rightArrow = '<div class="fp_arrow fp_rightArrow"><svg width="8" height="17" viewBox="0 0 8 17" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M1.00002 1L6.18966 8.20785C6.31531 8.38235 6.31531 8.61765 6.18966 8.79215L1.00001 16" stroke="#BDBDBD" stroke-width="2" stroke-linecap="round"/></svg></div>'
        var leftArrow = '<div class="fp_arrow fp_leftArrow"><svg width="8" height="17" viewBox="0 0 8 17" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M6.39999 16L1.21034 8.79215C1.08469 8.61765 1.08469 8.38235 1.21034 8.20785L6.39999 1" stroke="#BDBDBD" stroke-width="2" stroke-linecap="round"/></svg></div>'
        $('.product-single__image-wrapper').css('position', 'relative')
        $('.product-single__image-wrapper').append(rightArrow);
        $('.product-single__image-wrapper').append(leftArrow);
        var i = Math.ceil($('.product-single__thumb-wrapper').length * 66 / $('#ProductThumbs').width()) - 1;
        var j = 0;
        console.log(i)
        $('.fp_rightArrow').on('click', function() {
            if (j < i) {
                j++;
                $('#ProductThumbs').scrollLeft(200)
            }
        })

        $('.fp_leftArrow').on('click', function() {
            if (j >= i) {
                j--;
                $('#ProductThumbs').scrollLeft(0)
            }
        })

    },
    fixColor: function() {
        var selectedColor = $($('.swatch-active').parent()[0]).children('.tooltip').text()
        var limitedEditionColor = $('.swatch .lens__wrapper:contains("Limited Edition") .swatch-element .tooltip').text()

        var limitedEdition = ''
        if (selectedColor == limitedEditionColor) {
            limitedEdition = '<span class="fp_limited"> Limited Edition </span>'
        }
        if ($('.swatch .lens__title:contains("Limited Edition")').length) {
            $('.mobile-swatch div[layout-align="row space-between end"').append($('.swatch .lens__wrapper:contains("Limited Edition") div[layout-align="end end"]').html())
            $('.swatch .lens__wrapper:contains("Limited Edition")').hide()
        }
        $('.mobile-swatch .swatch__title').html('Color: <span class="fp_selectedColor">' + selectedColor + '</span>' + limitedEdition);

    },
    virtualMirror: function() {
        $('.vm__trigger').addClass('fp_virtual-btn');
        $('.vm__trigger').text('Try Our Virtual Mirror');
    },
    outOfStock: function() {
        $('#AddToCart').css('margin-bottom', '15px')
        $('#AddToCart').after($('.klaviyo-bis-trigger').clone())
    },
    determinePopup: function() {

        $('.lens__header .klaviyo-bis-trigger').remove();
        $('.variant-options .lens__header:nth-child(1)').append('<button class="fp_notsure"> Not Sure? </button>')

        var determineModal = '<div class="fp_modal_container fp_modal_container--first"><div class="fp_modal_klaviyo-bis-close fadein"><div class="w-100" id="klaviyo-bis-modal"><div class="fp_container"><button type="button" class="fp_close klaviyo-bis-close" data-dismiss="modal"></button><h3 class="fp_modal-title">Determine your magnification</h3><a href="https://cdn.shopify.com/s/files/1/0797/7215/t/299/assets/look-diopter-chart.pdf?v=9550415733820418510" target="_blank" download class="fp_btn btn-success btn-lg col-xs-12 download-eye-chart">Download Eye Chart</a> <span class="my-3">OR</span><button type="submit" class="fp_btn btn-success btn-lg col-xs-12 determine-by-age">Determine By Age</button> </div></div></div></div>';
        $('body').append(determineModal);





    },
    magnificationPopup: function() {
        var magnificationModal = '<div class="fp_modal_container fp_modal_container--second"><div class="fp_modal_klaviyo-bis-close fadein"><div class="w-100" id="klaviyo-bis-modal"><div class="fp_container"><button type="button" class="fp_close klaviyo-bis-close" data-dismiss="modal"></button><h3 class="fp_modal-title">magnification by age</h3> ';

        magnificationModal += '<table class="fp_magnificaation-table"> <tr><td>40-44</td><td> +0.75 to + 1.00 </td></tr> <tr><td>40-44</td><td> +0.75 to + 1.00 </td></tr> <tr><td>40-44</td><td> +0.75 to + 1.00 </td></tr> <tr><td>40-44</td><td> +0.75 to + 1.00 </td></tr> <tr><td>40-44</td><td> +0.75 to + 1.00 </td></tr> </table>';
        magnificationModal += '<span class="fp_back"><svg width="9" height="13" viewBox="0 0 9 13" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M8 12L0.999999 6.5L8 1" stroke="#101010"/></svg> <span>Back</span> </span> </div></div></div></div>'
        $('body').append(magnificationModal);
    },
    popupEvents: function() {
        $('.lens__header .fp_notsure').on('click', function(e) {
            e.preventDefault();
            $('.fp_modal_container--first').show();
        })

        $('.fp_close').on('click', function() {
            $('.fp_modal_container').hide();
        });

        $('.determine-by-age').on('click', function() {
            $('.fp_modal_container--first').hide();
            $('.fp_modal_container--second').show();
        })

        $('.fp_back').on('click', function() {
            $('.fp_modal_container--second').hide();
            $('.fp_modal_container--first').show();
        })


        $('.fp_modal_klaviyo-bis-close').on('click', function() {
            $('.fp_modal_container').hide();
        });

        $('.fp_container').on('click', function(e) {
            e.stopPropagation();
        });
    },
    addVideo: function() {
        var title = '<h3 class="video_title mt-5 pt-5"> Flexible. Comfortable.<br>THE PERFECT FIT </h3>'
        var poster = 'data:image/png;base64,'
        var videoContent = title + '<div class="video-container" id="video-container"><video controls id="video" preload="metadata" poster="' + poster + '"><source src="https://cdn.shopify.com/s/files/1/0797/7215/files/find_your_fit.mp4?v=1608194262" type="video/mp4"></video><div class="play-button-wrapper"><div title="Play video" class="play-gif" id="circle-play-b"><!-- SVG Play Button --><svg width="40" height="40" viewBox="0 0 40 40" fill="none" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" clip-rule="evenodd" d="M20 40C31.0457 40 40 31.0457 40 20C40 8.9543 31.0457 0 20 0C8.9543 0 0 8.9543 0 20C0 31.0457 8.9543 40 20 40ZM30.6627 20.1659C30.7804 20.0866 30.7804 19.9134 30.6627 19.8341L14.857 9.18781C14.7242 9.09833 14.5453 9.19352 14.5453 9.35369L14.5453 30.6463C14.5453 30.8064 14.7242 30.9016 14.857 30.8121L30.6627 20.1659Z" fill="white"/></svg><span>WATCH VIDEO</span></div></div></div>'
        $('.lo-product-guarantee').after(videoContent);

        var video = document.getElementById("video");
        var circlePlayButton = document.getElementById("circle-play-b");

        function togglePlay() {
            if (video.paused || video.ended) {
                video.play();
            } else {
                video.pause();
            }
        }

        circlePlayButton.addEventListener("click", togglePlay);
        video.addEventListener("playing", function() {
            circlePlayButton.style.opacity = 0;
        });
        video.addEventListener("pause", function() {
            circlePlayButton.style.opacity = 1;
        });




    },
    changeOrder: function() {
        $('.product-single__image-wrapper').after('<div class="product-single__info-wrapper fp_mt-7">' +
            $('.product-single__header-wrapper')[0].outerHTML +
            '</div>')
        $('.product-description-wrapper .product-single__header-wrapper').hide()
        $('div.addtocart-wrapper').before($('.product-description-wrapper')[0].outerHTML);
        $($('.product-description-wrapper')[0]).hide()
    },
    attachEvents: function() {
        $('#AddToCart').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "addToCart_click"
            }]);
        })

        $('.product-single__thumb-wrapper:first-child').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "heroPlayIcon_click"
            }]);
        })

        $('.play-gif').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "seperatePlayIcon_click"
            }]);
        })

        $('.fp_virtual-btn').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "virtualMirror_click"
            }]);
        })

        $('a.klaviyo-bis-trigger:contains("Out of Stock")').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "outOfStock_click"
            }]);
        })

        $('.fp_notsure').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "notSure_click"
            }]);
        })

        $('.fp_modal_container--first .fp_close').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "closeIcon_click"
            }]);
        })

        $('.download-eye-chart').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "downloadEyeChart_click"
            }]);
        })

        $('.determine-by-age').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "determineByAge_click"
            }]);
        })




    }

}.init();